import React, { Component } from "react";

import Card from "./Card";
import CountDown from "./CountDown";

import PaymentPic from "../../images/payment1.jpg";
import MemberCardPic from "../../images/memberCard2.jpg";
import MenuPic from "../../images/shabuMenu.jpg";

class Home extends Component {
  render() {
    return (
      <div>
        <div className="my-container" style={{ height: "100%" }}>
          <CountDown />
        </div>
        <div className="container">
          <div className="card-deck">
            <Card image={MenuPic} text="สั่งอาหาร" link="/food" />
            <Card image={MemberCardPic} text="สำหรับสมาชิก" link="member" />
            <Card image={PaymentPic} text="ชำระเงิน" link="payment" />
          </div>
        </div>
      </div>
    );
  }
}
/*
<Card image={MenuPic} text="สั่งอาหาร" />
<Card image={MemberCardPic} text="สำหรับสมาชิก" />
<Card image={PaymentPic} text="ชำระเงิน" />

            <NavLink to="/food">
              <Card image={MenuPic} text="สั่งอาหาร" />
            </NavLink>
            <NavLink to="/member">
              <Card image={MemberCardPic} text="สำหรับสมาชิก" />
            </NavLink>
            <NavLink to="/payment">
              <Card image={PaymentPic} text="ชำระเงิน" />
            </NavLink>
*/
export default Home;
